msg:
兼容mysql的另一种语法：
show columns from tableName in databaseName;
之前只支持show columns from tableName from databaseName;

修改关于 NULL 的问题

Oracle 中  原始sql  ：alter table aaa modify bbb null;
转换后成为：  ALTER TABLE  aaa  MODIFY ( bbb DEFAULT NULL );
原始Sql的语义改变了，改变了字段的default值

